import Axios from "axios";

const host = "http://127.0.0.1:4567"

const AxiosUtils = module.exports

AxiosUtils.post = (link, data) => {
    return Axios.post(`${host}${link}`, data).then((res) => {
        res.data
    })
}

export {AxiosUtils};
